//SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.6.0;
pragma experimental ABIEncoderV2;


contract Student{
    struct information{
        uint studentId;
        string studentName;
        address studentAddress;
    }

    information studentInfo = information(0,"null",owner);
    address private owner;

    constructor(){
        owner = msg.sender;
    }

    function addStudentInfomation(uint id, string memory name) public {
        require(studentInfo.studentId == 0, "You'r infomation already registed");
        studentInfo = information(id,name,owner);
    }

}

